import json
from binascii import hexlify, unhexlify
from io import BytesIO
from unittest import TestCase, main

from ComplexEncoder import ComplexEncoder
from Utilities import bytesToInt, varInt
from Utilities import readAndResetStream
from transaction.Transaction import Transaction
from utils.EncoderDecoder import switchEndianAndDecode
from utils.Sha256Hash import doubleSha256


class Block:
    def __init__(self, block_hash, size, strippedsize, version, previousblockhash, merkleroot, timestamp,
                 bits, nonce, txs, difficulty):
        self.hash = block_hash
        self.size = size
        self.strippedsize = strippedsize
        self.version = version
        self.previousblockhash = previousblockhash
        self.merkleroot = merkleroot
        self.timestamp = timestamp
        self.bits = bits
        self.nonce = nonce
        self.txs = txs
        self.difficulty = difficulty

    def toString(self):
        return dict(
            hash=self.hash,
            size=self.size,
            strippedsize=self.strippedsize,
            version=self.version,
            merkleroot=self.merkleroot,
            txs=self.txs,
            nonce=self.nonce,
            timestamp=self.timestamp,
            bits=self.bits,
            difficulty=self.difficulty,
            previousblockhash=self.previousblockhash
        )

    @classmethod
    def parse(cls, stream):
        version = bytesToInt(stream.read(4))
        previousblockhash = switchEndianAndDecode(stream.read(32))
        merkleroot = switchEndianAndDecode(stream.read(32))
        timestamp = bytesToInt(stream.read(4))

        bits_bytes = stream.read(4)
        bits = hexlify(bits_bytes[::-1]).decode('ascii')
        difficulty = cls.findDifficulty(bits_bytes[::-1])

        nonce = bytesToInt(stream.read(4))

        hash_bytes = readAndResetStream(stream, stream.tell(), 0, stream.tell())
        block_hash = switchEndianAndDecode(doubleSha256(hash_bytes))

        tx_count = varInt(stream)
        txs = [Transaction.parse(stream) for _ in range(tx_count)]
        txs_witness_length = sum(tx.witnesslength for tx in txs)

        size = len(stream.getvalue())
        strippedsize = size - txs_witness_length
        return cls(block_hash, size, strippedsize, version, previousblockhash, merkleroot, timestamp,
                   bits, nonce, txs, difficulty)

    @staticmethod
    def findDifficulty(bits_bytes):
        exponent = bits_bytes[0]
        coefficient = int.from_bytes(bits_bytes[1:4], 'big')
        target = coefficient * 2 ** (8 * (exponent - 3))
        difficulty = 0x00000000FFFF0000000000000000000000000000000000000000000000000000 / int(hex(target), 16)
        return difficulty


class TestBlock(TestCase):
    def test_parse(self):
        raw_block = ''
        block = Block.parse(BytesIO(unhexlify(raw_block)))
        print(json.dumps(block.toString(), cls=ComplexEncoder, indent=2))

    def test_findDifficulty(self):
        bits = 'e93c0118'
        difficulty = Block.findDifficulty(unhexlify(bits)[::-1])
        assert difficulty == 888171856257.3206


if __name__ == '__main__':
    main()
